import React, { Component } from 'react';
import { Tabs } from 'react-simple-tabs-component';
import "./CoinsTab.css";
import Todayhot from '../Todayhot';

class CoinsTab extends Component {
	
	render() {
		const TabTwo = () => {
			return (
				<>
				<h3>Tab Two</h3>
				<p>
					Lorem ipsum dolor sit amet, consectetur adipisicing elit. Perferendis sint illum iusto nostrum cumque qui
					voluptas tenetur inventore ut quis?
				</p>
				</>
			)
		}
		
		const TabThree = () => {
			return (
				<>
				<h3>Tab Three</h3>
				<p>
					Lorem ipsum dolor sit amet, consectetur adipisicing elit. Perferendis sint illum iusto nostrum cumque qui
					voluptas tenetur inventore ut quis?
				</p>
				</>
			)
		}

		// Tabs structure Array
		const tabs = [
			{
				label: 'Normal', // Tab Title - String
				Component: Todayhot // Tab Body - JSX.Element
			},
			{
				label: 'Today Hot',
				Component: TabTwo
			},
			{
				label: 'New',
				Component: TabThree
			},
			{
				label: 'All Time Best',
				Component: TabThree
			},
			{
				label: 'All Time Best',
				Component: TabThree
			}
		]
		
		return (
			<div className="container" style={{width:'auto'}}>
				<div className="col-md-12">
					<h4 className="headline margin-top-30 margin-bottom-40">Today hot</h4>
					<Tabs tabs={tabs} /* Props */ />
				</div>
			</div>
		);
	}
}

export default CoinsTab;
